import React from 'react'
import ListItem from './ListItem'

const Content = ({items}) => {
  return (
    <div className='table-container'>
    <table>
       {items.map(item =>(
            <ListItem 
                key={item.id}
                item = {item}
            />
       ))}
    </table>
    </div>
  )
}

export default Content
